def prepareOneVsAll(data, class1):
    return data[:,1:], (data[:,0] == class1)*2. - 1.

def prepareOneVsOne(data, class1, class2):
    sel = np.logical_or(data[:,0] == class1, data[:,0] == class2)
    return data[sel,1:], (data[sel,0] == class1)*2. - 1.

